<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta content="IE=edge" http-equiv="X-UA-Compatible">
    <meta content="width=device-width, initial-scale=1.0" name="viewport">


    <link href="/img/favicon.ico" rel="shortcut icon">
    <title>My Docs</title>
    <link href="/css/bootstrap.min.css" rel="stylesheet">
    <link href="/css/font-awesome.min.css" rel="stylesheet">
    <link href="/css/base.css" rel="stylesheet">
    <link href="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/10.5.0/styles/github.min.css" rel="stylesheet">
    <link href="/assets/_mkdocstrings.css" rel="stylesheet">

    <script defer src="/js/jquery-1.10.2.min.js"></script>
    <script defer src="/js/bootstrap.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/highlight.js/10.5.0/highlight.min.js"></script>
    <script>hljs.initHighlightingOnLoad();</script>
</head>

<body>
<div class="navbar fixed-top navbar-expand-lg navbar-dark bg-primary">
    <div class="container">
        <a class="navbar-brand" href="/.">My Docs</a>

        <!-- Expanded navigation -->
        <div class="navbar-collapse collapse" id="navbar-collapse">

            <ul class="nav navbar-nav ml-auto">
            </ul>
        </div>
    </div>
</div>

<div class="container">
    <div class="row">

        <div class="row-fluid">
            <div class="span12" id="main-content">
                <h1 id="404-page-not-found" style="text-align: center">404</h1>
                <p style="text-align: center"><strong>Page not found</strong></p>
            </div>
        </div>


    </div>
</div>

<footer class="col-md-12">
    <hr>
    <p>Documentation built with <a href="https://www.mkdocs.org/">MkDocs</a>.</p>
</footer>
<script>
    var base_url = "/",
        shortcuts = {"help": 191, "next": 78, "previous": 80, "search": 83};
</script>
<script defer src="/js/base.js"></script>

<div aria-hidden="true" aria-labelledby="keyboardModalLabel" class="modal" id="mkdocs_keyboard_modal" role="dialog"
     tabindex="-1">
    <div class="modal-dialog">
        <div class="modal-content">
            <div class="modal-header">
                <h4 class="modal-title" id="keyboardModalLabel">Keyboard Shortcuts</h4>
                <button class="close" data-dismiss="modal" type="button"><span aria-hidden="true">&times;</span><span
                        class="sr-only">Close</span></button>
            </div>
            <div class="modal-body">
                <table class="table">
                    <thead>
                    <tr>
                        <th style="width: 20%;">Keys</th>
                        <th>Action</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td class="help shortcut"><kbd>?</kbd></td>
                        <td>Open this help</td>
                    </tr>
                    <tr>
                        <td class="next shortcut"><kbd>n</kbd></td>
                        <td>Next page</td>
                    </tr>
                    <tr>
                        <td class="prev shortcut"><kbd>p</kbd></td>
                        <td>Previous page</td>
                    </tr>
                    <tr>
                        <td class="search shortcut"><kbd>s</kbd></td>
                        <td>Search</td>
                    </tr>
                    </tbody>
                </table>
            </div>
            <div class="modal-footer">
            </div>
        </div>
    </div>
</div>

</body>
</html>
